export function tsTypeAliasSnippet(typeName, typeValue) {
    return `
 
export type ${typeName} = ${typeValue}
  
  `;
}
export function tsEnumSnippet(enumName, key, value) {
    return `
  
export enum ${enumName} {
  ${key} = ${value}
}
  
  `;
}
export function namedExportSnippet(exportName, constName) {
    if (constName)
        return `
  
 const ${constName} = { ${exportName} }

 export ${constName}
  
  `;
    return `

export { ${exportName} }

  `;
}
export function classSnippet(className, classMember) {
    return `

class ${className}{
  constructor(){}

  ${classMember}
}

`;
}
